deck_description:
This is such a complex deck lol

&nbsp;

-Normal Mo ye, make Chi xiao, search trap. If you already have it, search tactician.

Always use Tai A effect after special summoning him from the grave. Please, try not wasting your normal summon on him. Use his effect on ashuna, or send the trap so you can have banish it with Chi xiao and create a target for the trap you searched.

You can use adhara to add back your boys after you banish them up. Use ashuna to extend your plays or to create non-effect monsters.

&nbsp;

The entire deck is a toolbox since these boys can make pretty much any synchro from 6-12.

&nbsp;

Try always ending on Chi xiao, Baroness de fleur and the Sudden shift trap.

If you want, you can make Cheng ying instead of baroness and trade a Omni negate with a quick effect, non target banish from field and grave.

&nbsp;

For the love of god don't forget about the tenyi's requirments. Keep some tokens for ashuna, and don't forget that they lock you into wyrms.

&nbsp;

Remember, the tokens you create are non-effect monsters. :)

Standard pure marincess with splash of frog engine.

&nbsp;

Toadally Awesome is easy enough to get to without Bahamut, do not have a Bahamut.

This here is a Speedroid deck with all of the new support from Duelists of Whirlwind. I decided to name this card after the theme song of an old video game I had as a kid, <em>Sonic and The Black Knight. </em>I was a major Sonic the Hedgehog fan as a preteen.

&nbsp;

Anyways, this deck is good going first or second. If you're going first, just summon Crystal Wing or Crystal Clear Wing and set Speedroid Dupligate. If you're going second, use your 9 hand traps to disrupt your opponent's plays so you can OTK them on your turn.

